import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

export default function AdminPanel() {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user'));

  useEffect(() => {
    if (!user || user.role.toLowerCase() !== 'admin') {
      navigate('/unauthorized');
    }
  }, [user, navigate]);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  const modules = [
    { title: 'Properties', icon: 'üè†', desc: 'Manage property listings and details.', path: '/properties' },
    { title: 'Tenants', icon: 'üë•', desc: 'View and manage tenant accounts.', path: '/tenants' },
    { title: 'Maintenance', icon: 'üõ†Ô∏è', desc: 'Review and assign maintenance requests.', path: '/maintenance' },
    { title: 'Passcodes', icon: 'üîê', desc: 'Access and manage smart passcodes.', path: '/passcodes' }
  ];

  return (
    <div style={pageStyle}>
      {/* Top navigation bar */}
      <nav style={navStyle}>
        <div style={navLeft}>üè¢ Admin Portal</div>
        <div style={navRight}>
          <button style={navButton} onClick={() => navigate('/admin-panel')}>Dashboard</button>
          <button style={logoutButton} onClick={handleLogout}>Logout</button>
        </div>
      </nav>

      {/* Main content */}
      <div style={containerStyle}>
        <h2 style={headingStyle}>Welcome, {user?.name}</h2>
        <p style={subHeadingStyle}>Role: <strong>{user?.role}</strong></p>

        <div style={cardGrid}>
          {modules.map((mod) => (
            <div
              key={mod.title}
              style={card}
              onClick={() => navigate(mod.path)}
              onMouseEnter={(e) => e.currentTarget.style.transform = 'scale(1.03)'}
              onMouseLeave={(e) => e.currentTarget.style.transform = 'scale(1)'}
            >
              <div style={cardIcon}>{mod.icon}</div>
              <h3 style={cardTitle}>{mod.title}</h3>
              <p style={cardDesc}>{mod.desc}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

/* Styles */
const pageStyle = {
  backgroundColor: '#f4f6f8',
  minHeight: '100vh',
  fontFamily: 'Segoe UI, sans-serif'
};

const navStyle = {
  background: '#2563eb',
  color: '#fff',
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  padding: '1rem 2rem',
  boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
  position: 'sticky',
  top: 0,
  zIndex: 1000
};

const navLeft = { fontWeight: 'bold', fontSize: '1.4rem' };
const navRight = { display: 'flex', gap: '1rem' };
const navButton = {
  background: 'transparent',
  border: 'none',
  color: '#fff',
  fontSize: '1rem',
  fontWeight: '500',
  cursor: 'pointer',
  padding: '0.5rem 1rem',
  borderRadius: '6px',
  transition: 'background-color 0.2s ease'
};

const logoutButton = {
  background: '#dc2626',
  border: 'none',
  color: '#fff',
  padding: '0.5rem 1rem',
  borderRadius: '6px',
  fontWeight: '500',
  cursor: 'pointer'
};

const containerStyle = {
  padding: '2rem',
  textAlign: 'center'
};

const headingStyle = {
  fontSize: '2rem',
  marginBottom: '0.25rem',
  color: '#111'
};

const subHeadingStyle = {
  fontSize: '1rem',
  marginBottom: '2rem',
  color: '#555'
};

const cardGrid = {
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fit, minmax(220px, 1fr))',
  gap: '1.5rem',
  marginTop: '2rem'
};

const card = {
  backgroundColor: '#fff',
  borderRadius: '12px',
  boxShadow: '0 4px 12px rgba(0,0,0,0.08)',
  padding: '1.5rem',
  cursor: 'pointer',
  transition: 'transform 0.2s ease',
  textAlign: 'center'
};

const cardIcon = {
  fontSize: '2rem',
  marginBottom: '0.5rem'
};

const cardTitle = {
  fontSize: '1.2rem',
  fontWeight: '600',
  marginBottom: '0.3rem',
  color: '#111'
};

const cardDesc = {
  fontSize: '0.9rem',
  color: '#555'
};
